import React from 'react';
import './sass/css/policies.css';
export default function Policies() {
    return (
        <div policies-container>
            {Array.from({length:3}).map((item,index)=>{
                return (
                    
                    <div className={`${itemOrder}`}>
                        
                    </div>
                )
            }
            )}
        </div>
    )
}
